import styled from 'styled-components'

export const Item = styled.div`
  color: white;
  display: flex;
  margin: 0 auto;
  justify-content: center;
`
export const ContainerImg = styled.div`
  width: 50%;

  img {
    max-width: 520px;
  }
`
export const Information = styled.div`
  align-items: center;
  width: 50%;
  margin-left: 52px;
